import base64, io, re
import pdfplumber

# Padrões de regex para encontrar o número da NF a partir do rótulo
ANCHOR_PATTERNS = [
    r"NOTA\s*FISCAL/INVOICE[^\d]{0,30}(\d{6,12})",
    r"NOTA\s*FISCAL/INVOICE[^\n\r]{0,50}?(?:n[ºo\.]?\s*)?(\d{6,12})",
]

def _normalize(s):
    return re.sub(r"\s+", " ", s or "").strip()

def _from_text(pdf_bytes: bytes):
    texts = []
    with pdfplumber.open(io.BytesIO(pdf_bytes)) as pdf:
        for p in pdf.pages:
            t = p.extract_text() or ""
            texts.append(t)
    full = "\n".join(texts)

    # 1) Tenta regex no texto inteiro
    for pat in ANCHOR_PATTERNS:
        m = re.search(pat, full, flags=re.I)
        if m:
            return m.group(1)

    # 2) Procura linha a linha
    lines = full.splitlines()
    for i, line in enumerate(lines):
        if re.search(r"NOTA\s*FISCAL/INVOICE", line, flags=re.I):
            # mesma linha
            m = re.search(r"(\d{6,12})", line)
            if m:
                return m.group(1)
            # linhas seguintes
            for j in range(1, 3):
                if i + j < len(lines):
                    m2 = re.search(r"(\d{6,12})", lines[i + j])
                    if m2:
                        return m2.group(1)
    return None

def extrair_nf_por_rotulo_nfi(pdf_base64: str) -> str | None:
    """Extrai número da NF a partir do base64 de um PDF."""
    pdf_bytes = base64.b64decode(pdf_base64)
    nf = _from_text(pdf_bytes)
    return _normalize(nf) if nf else None

